// SPDX-License-Identifier: MIT
pragma solidity ^0.8;

// Name: LemonToken  柠檬币    symbol: NMB
contract ERC20test  {
    mapping (address account => uint256) _balances;

    uint256 private _totalSupply = 0;

    string private _name;
    string private _symbol;

    address public owner;

    // 授权额度映射
    mapping(address => mapping(address => uint256)) private _allowances;
    
    // 转账事件
    event Transfer(address indexed from, address indexed to, uint256 value);
    
    // 授权事件
    event Approval(address indexed owner, address indexed spender, uint256 value);


    constructor(string memory name_, string memory symbol_,uint256 initToken_) {
        _name = name_;
        _symbol = symbol_;
        owner = msg.sender;
        _mint(msg.sender, initToken_);
    }


    function name() public view virtual returns (string memory) {
        return _name;
    }
    function symbol() public view virtual returns (string memory) {
        return _symbol;
    }
    function decimals() public view virtual returns (uint8) {
        return 18;
    }
    function totalSupply() public view virtual returns (uint256) {
        return _totalSupply;
    }

    function balanceOf(address user) public view returns (uint256) {
        return _balances[user];
    } 

    function transfer(address to,uint256 amount) public returns (bool) {
        require(to != address(0),"transfer to the zero address");
        require(_balances[msg.sender] >= amount,"transfer amount exceeds balance");

        _balances[msg.sender] -= amount;
        _balances[to] += amount;

        emit Transfer(msg.sender, to, amount);

        return true;
    }

   function approve(address spender, uint256 amount) public returns (bool) {
        _allowances[msg.sender][spender] = amount;
        emit Approval(msg.sender, spender, amount);
        return true;
    }
    
   function allowance(address _owner, address spender) public view returns (uint256) {
        return _allowances[_owner][spender];
    }

        // 代扣转账
    function transferFrom(address from, address to, uint256 amount) public returns (bool) {
        require(to != address(0), "ERC20: transfer to the zero address");
        require(_balances[from] >= amount, "ERC20: transfer amount exceeds balance");
        require(_allowances[from][msg.sender] >= amount, "ERC20: transfer amount exceeds allowance");
        
        _balances[from] -= amount;
        _balances[to] += amount;
        _allowances[from][msg.sender] -= amount;
        
        emit Transfer(from, to, amount);
        return true;
    }
    
    

        // 增发代币（仅所有者）
    function mint(address to, uint256 amount) public {
        require(msg.sender == owner, "ERC20: only owner can mint");
        _mint(to, amount);
    }
    
    // 内部铸币函数
    function _mint(address account, uint256 amount) internal {
        require(account != address(0), "ERC20: mint to the zero address");
        
        _totalSupply += amount;
        _balances[account] += amount;
        
        emit Transfer(address(0), account, amount);
    }
}

